INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (4.8, 10021, 2, 2002, -470.0, 5, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", "ネア", 0.0, "2024/09/22 14:59:59", "2024/06/15 15:00:00", 123301, 1, 2);
