INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (2.295, 10038, 1, 2002, -470.0, 10, "クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪", "クルル", 0.0, "2025/12/23 14:59:59", "2025/09/16 15:00:00", 130901, 2, 2);
